  `ac_acc_id` bigint(20) DEFAULT NULL,
  `ac_rebate` decimal(3,2) DEFAULT NULL,
  PRIMARY KEY (`id`),
  KEY `FK11BFAD20D8BBB351` (`ac_acc_id`),
